import {useState} from "react";
import OpenWidget from "./Components/OpenWidget";
import ZohoProvider from './Context/ZohoContext';


function App() {

  const [link, setLink] = useState("openWidget");


  return (
    <ZohoProvider>
      {link == "openWidget" ? 
          <OpenWidget setLink={setLink}/>
          : ""
      }

    </ZohoProvider>
  );
}

export default App;
